import './App.css';
import {Routes, Route} from 'react-router-dom';

function AppHome() {
  return (
    <div className="App">
      <header className="App-header">
        <a
          className="App-logo"
          href="/"
          target="_self"
          rel="noopener noreferrer"
        >
          CodeTrackr
        </a>
      </header>
      <Routes>
          <Route path="/home" element={<AppHome />} />
      </Routes>
    </div>
  );
}

export default AppHome;
